import React, { Component } from "react";
import PropTypes from 'prop-types';
import { players } from "./constants/players.js";

import Grid from '@material-ui/core/Grid';
import Avatar from '@material-ui/core/Avatar';
import Typography from "@material-ui/core/Typography";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';


import "./App.css";

const styles = {
  avatar: {
    margin: 50,
    width: 300,
    height: 300,
  },
  title: {
    paddingTop: 100,
    paddingBottom: 100
  },
  wordAvatar: {
    margin: 10,
    color: '#fff',
    backgroundColor: deepOrange[500],
  }
};

const stats = {
  "Pos": "SF",
  "Age": 34,
  "Tm": "LAL",
  "G": 39,
  "GS": 39,
  "MP": 34.9,
  "FG": 9.8,
  "FGA": 19.2,
  "FG%": 0.513,
  "3P": 2.1,
  "3PA": 5.8,
  "3P%": 0.355,
  "2P": 7.7,
  "2PA": 13.3,
  "2P%": 0.582,
  "eFG%": 0.567,
  "FT": 5.1,
  "FTA": 7.4,
  "FT%": 0.679,
  "ORB": 0.9,
  "DRB": 7.7,
  "TRB": 8.6,
  "AST": 7.6,
  "STL": 1.3,
  "BLK": 0.6,
  "TOV": 3.5,
  "PF": 1.7,
  "PS/G": 26.8
}

function PlayerInfoPage(props) {
  return (
    <Grid container direction="column">
      <Avatar src={players[0].img} style={styles.avatar} />
      <Typography variant="h1" style={styles.title}>{players[0].name}</Typography>
      <List>
        <ListItem >
          <ListItemAvatar>
            <Avatar style={styles.wordAvatar}>Pos</Avatar>
          </ListItemAvatar>
          <ListItemText primary="SF" />
        </ListItem>
        <ListItem>
          <ListItemIcon>
            <DraftsIcon />
          </ListItemIcon>
          <ListItemText primary="Drafts" />
        </ListItem>
      </List>
    </Grid>
  );
}

